    def img_add():
        folder = window['-folder_name-'].get()
        print(folder)
        # img_types = (".png", ".jpg", "jpeg", ".tiff", ".bmp")
        # flist0 = os.listdir(folder)
        # #print('flist0', flist0)
        # fnames = [f for f in flist0 if os.path.isfile(
        #     os.path.join(folder, f)) and f.lower().endswith(img_types)] #转小写 后对比后缀
        iter = Path(folder).iterdir()
        img_types = (".png", ".jpg", "jpeg", ".tiff", ".bmp")
        fnames=[str(item) for item in iter if str(item).lower().endswith(img_types)]#先转小写 再比对后缀
        print('fnames',fnames)
        maxfnames = len(fnames)
        if maxfnames>0:
            window['-image_lbox-'].update('共找到%s张图片'%maxfnames)
        else:
            window['-image_lbox-'].update('没找到图片',text_color='red')
            return None
        print("window['-img_num-'].get()",window['-img_num-'].get())
        num = re.findall(r'[1-9]$|[^0]\d+$',window['-img_num-'].get())
        print('numsss',num)
        num = int(num[0]) if num!=[] else 3
        num= num if num<maxfnames else maxfnames
        print('num',num)
        #del flist0

        def get_img_data(f, first=False):
            img = Image.open(f)
            if first:
                bio = io.BytesIO()
                img.save(bio, format="PNG")
                del img
                return bio.getvalue()
            return ImageTk.PhotoImage(img)  # 使用PIL（Python Image Library）库实现非gif图片的使用。

        def get_imgobj(*args):
            nonlocal new_img_w,new_img_h,fnames_tmp_img
            #print('获取图片对象---')
            img_obj = Image.open(args[0])
            img_w, img_h = img_obj.size
            new_img_w = img_w if img_w < img_w else img_w
            new_img_h += img_h
            fnames_tmp_img.append([img_obj,args[1]])

        #window['-img_add-'].update(data=get_img_data(filename, first=True))
        new_id=1
        max_new_id=int(maxfnames/num)
        max_new_id=max_new_id+1 if maxfnames%num else max_new_id

        # new_folder = os.path.join(folder, 'new')
        # if not os.path.exists(new_folder): os.mkdir(new_folder)
        # else:
        #     old_files = os.listdir(new_folder)
        #     for old_file in old_files:
        #         os.remove(os.path.join(new_folder,old_file))

        new_folder = Path(folder)/'new'
        if not Path(new_folder).exists(): Path(new_folder).mkdir()
        else:
            old_files = Path(new_folder).iterdir()
            for old_file in old_files:
                Path(old_file).unlink()

        starttime = time.perf_counter()
        for fname in fnames:
            new_img_w = 0
            new_img_h = 0
            fnames_tmp_img = []
            excutor = ThreadPoolExecutor(10)
            f_idx=fnames.index(fname)
            if f_idx%num==0:
                end_idx=f_idx+num if f_idx+num<maxfnames else maxfnames
                #fnames_tmp=[os.path.join(folder, fna) for fna in  fnames[f_idx:end_idx]]
                fnames_tmp=fnames[f_idx:end_idx]
                #print('fnames_tmp',fnames_tmp)
                for i in range(len(fnames_tmp)):
                    excutor.submit(get_imgobj,fnames_tmp[i],i)
                    #get_imgobj(fnames_tmp[i],i)
                excutor.shutdown(True)
                #多线程拿到img对象 但顺序不一定 需要重新排序
                fnames_tmp_img=sorted(fnames_tmp_img ,key=lambda x:x[1])
                #print('fnames_tmp_img',fnames_tmp_img)

                newimage = Image.new("RGB", (new_img_w, new_img_h))
                newh = 0
                starttime = time.perf_counter()
                for image in fnames_tmp_img:
                    #image.show()
                    b_w, b_h = image[0].size
                    newimage.paste(image[0], (0, newh))
                    newh += b_h


                #new_file=os.path.join(new_folder,str(new_id)+'.jpg')
                new_file=Path(new_folder)/(str(new_id)+'.jpg')
                print('new_file',new_file)
                new_id+=1
                window['-image_lbox-'].update(str(new_file)+'一共%s张图，正在合并...'%max_new_id)
                newimage.save(new_file)
                #newimage.show()
                # with io.BytesIO() as bio2:
                #     newimage.save(bio2, format="PNG")
                #     del newimage
                    #cover_resize_base64 = bio2.getvalue()
                    #window['-img_add-'].update(data=cover_resize_base64)
        window['-image_lbox-'].update('图片合并完成', text_color='blue')
        print('线程耗时：', time.perf_counter() - starttime)

